import { Carousel } from 'antd';
import '../css/main.css'

 const Photo = () => {
  return (
    <Carousel autoplay>
      <div>
        <h3  className="photo">1</h3>
      </div>
      <div>
        <h3  className="photo">2</h3>
      </div>
      <div>
        <h3  className="photo">3</h3>
      </div>
      <div>
        <h3  className="photo">4</h3>
      </div>
    </Carousel>
  )
};
 export default Photo;
